import React, { useEffect, useState } from "react";
import { Container, Image, Row, Col } from "react-bootstrap";
import { Input, Radio, Space, Tooltip, Button } from "antd";

import styles from "./styles.module.css";
import {
  IconLogos,
  IconsCalendar,
  IconImages1,
  IconImages2,
  IconImages3,
  IconsWa,
  IconTableLink,
  IconsLogosOv,
} from "../../assets";

import { useLocation, useNavigate } from "react-router-dom";

const LoginPage = () => {
  const navigate = useNavigate();
  const [jawaban, setJawaban] = useState("");
  const choosePage3 = () => {
    navigate("/page3");
  };
  return (
    <div className={styles.pages}>
      {/* <Helmet title="Home" /> */}
      <Row className={styles.rowHeader}>
        <Col xs={2}>
          <Image src={IconTableLink} className={styles.imgMenu} />
        </Col>
        <Col xs={8}>
          <p className={styles.textWallet}>Tablelink</p>
        </Col>
      </Row>
      <Container className={styles.containerHeader}>
        <Row style={{ marginTop: "26px" }}>
          <h5 className={styles.textWalletH5}>Selesaikan Teka Teki Ini!</h5>
        </Row>
        <Row style={{ marginTop: "16px" }}>
          <h5 className={styles.textWalletp}>
            Pesawat jatuh, kapal tenggelam. Ketemunya di mana?
          </h5>
        </Row>
        <Row style={{ marginTop: "10px" }}>
          <Input
            placeholder="Jawaban"
            onChange={(e) => setJawaban(e.target.value)}
            // prefix={<UserOutlined className="site-form-item-icon" />}
            status="warning"
          />
        </Row>
        <Button variant="success">Success</Button>{" "}
      </Container>
    </div>
  );
};

export default LoginPage;
